import React from 'react';
import './App.css';
import { Routes, Route, BrowserRouter as Router } from 'react-router-dom';
import UserContainer from '../src/Component/UserPage/container';
import { UserRequestData } from './Component/UserPage/action';

interface UserData {
  id: number;
  username: string;
  email: string;
  // Add other user-related properties as needed
}

interface DispatchProps {
  fetchUserRequest: (data: UserRequestData) => void;
  // Add other action dispatch functions if needed
}

interface UserState {
  userData: UserData | null;
  loading: boolean;
  error: string | null;
}

// Combine DispatchProps and UserState into a single type
type UserContainerProps = DispatchProps & UserState;

function App(): JSX.Element {
  return (
    <div>
      <Router>
        <Routes>
          {/* Pass the type as a prop for UserContainer */}
          <Route path="/" element={<UserContainer  {...UserContainerProps} />} />
          {/* <Route path="/user" element={<UserPage />} /> */}
        </Routes>
      </Router>
    </div>
  );
}

export default App;
